import cellphone from '../../../assets/cellphone.png';
import cellphoneBackground1 from '../../../assets/cellphone_background1.jpg';
import cellphoneBackground2 from '../../../assets/cellphoneBackground2.jpg';
import cellphoneBackground3 from '../../../assets/cellphoneBackground3.jpg';

const Cellphone = () => {
  const altMensage = "it was't possible to load this image";

  return (
    <div id="cellphone-container">
      <img src={cellphone} alt={altMensage} id="cellphone-image"/>

      <div id="container-of-cellphone-screen-image">
        <img src={cellphoneBackground1} alt={altMensage} className="invisible"/>
        <img src={cellphoneBackground2} alt={altMensage} className="invisible"/>
        <img src={cellphoneBackground3} alt={altMensage} />
      </div>
    </div>
  )
}

export default Cellphone;
